// src/services/adminApi.js - النسخة المصححة
import axios from "axios";

const API = axios.create({
  baseURL: "http://127.0.0.1:8000/api",
});

API.interceptors.request.use((config) => {
  const token = localStorage.getItem("token");
  if (token) {
    config.headers.Authorization = `Bearer ${token}`;
  }
  return config;
});

// Interceptor لمعالجة الأخطاء
API.interceptors.response.use(
  (response) => response,
  (error) => {
    if (error.response?.status === 401) {
      localStorage.removeItem("token");
      window.location.href = "/login";
    }
    return Promise.reject(error);
  }
);

// ===== Dashboard API =====
export const getAdminDashboard = () => API.get("/admin/dashboard");

// ===== General Entity Operations =====
export const entityApi = {
  // دالة عامة للحذف - متوافقة مع الكود الحالي
  delete: (table, id) => API.delete(`/${table}/${id}`),

  // دالة للحصول على أحدث البيانات
  getLatest: (table, limit = 5) =>
    API.get(`/${table}?limit=${limit}&sort=desc`),

  // دالة للإنشاء
  create: (table, data) => API.post(`/${table}`, data),

  // دالة للتحديث
  update: (table, id, data) => API.put(`/${table}/${id}`, data),
};

// ===== Users API - متوافق مع Laravel =====
export const usersApi = {
  get: () => API.get("/users"),
  getLatest: (limit = 5) =>
    API.get(`/users?limit=${limit}&sort_by=created_at&order=desc`),
  getOne: (id) => API.get(`/users/${id}`),
  create: (data) => API.post("/users", data),
  update: (id, data) => API.put(`/users/${id}`, data),
  delete: (id) => API.delete(`/users/${id}`),
  changeStatus: (id, status) => API.patch(`/users/${id}`, { status }),
};

// ===== Categories API - متوافق مع Laravel =====
export const categoriesApi = {
  get: () => API.get("/categories"),
  getLatest: (limit = 5) =>
    API.get(`/categories?limit=${limit}&sort_by=created_at&order=desc`),
  getOne: (id) => API.get(`/categories/${id}`),
  create: (data) => API.post("/categories", data),
  update: (id, data) => API.put(`/categories/${id}`, data),
  delete: (id) => API.delete(`/categories/${id}`),
};

// ===== Products API - متوافق مع Laravel =====
export const productsApi = {
  get: () => API.get("/products"),
  getLatest: (limit = 5) =>
    API.get(`/products?limit=${limit}&sort_by=created_at&order=desc`),
  getOne: (id) => API.get(`/products/${id}`),
  create: (data) => API.post("/products", data),
  update: (id, data) => API.put(`/products/${id}`, data),
  delete: (id) => API.delete(`/products/${id}`),
};

// ===== Customers API - متوافق مع Laravel =====
export const customersApi = {
  get: () => API.get("/customers"),
  getLatest: (limit = 5) =>
    API.get(`/customers?limit=${limit}&sort_by=created_at&order=desc`),
  getOne: (id) => API.get(`/customers/${id}`),
  create: (data) => API.post("/customers", data),
  update: (id, data) => API.put(`/customers/${id}`, data),
  delete: (id) => API.delete(`/customers/${id}`),
};

// ===== Orders API - متوافق مع Laravel =====
export const ordersApi = {
  get: () => API.get("/orders"),
  getLatest: (limit = 5) =>
    API.get(`/orders?limit=${limit}&sort_by=created_at&order=desc`),
  getOne: (id) => API.get(`/orders/${id}`),
  create: (data) => API.post("/orders", data),
  update: (id, data) => API.put(`/orders/${id}`, data),
  delete: (id) => API.delete(`/orders/${id}`),
};

// ===== Employees API - متوافق مع Laravel =====
export const employeesApi = {
  get: () => API.get("/employees"),
  getLatest: (limit = 5) =>
    API.get(`/employees?limit=${limit}&sort_by=created_at&order=desc`),
  getOne: (id) => API.get(`/employees/${id}`),
  create: (data) => API.post("/employees", data),
  update: (id, data) => API.put(`/employees/${id}`, data),
  delete: (id) => API.delete(`/employees/${id}`),
};

// ===== Sales API - متوافق مع Laravel =====
export const salesApi = {
  get: () => API.get("/sales"),
  getLatest: (limit = 5) =>
    API.get(`/sales?limit=${limit}&sort_by=created_at&order=desc`),
  getOne: (id) => API.get(`/sales/${id}`),
  create: (data) => API.post("/sales", data),
  update: (id, data) => API.put(`/sales/${id}`, data),
  delete: (id) => API.delete(`/sales/${id}`),
};

// ===== Reservations API - متوافق مع Laravel =====
export const reservationsApi = {
  get: () => API.get("/reservations"),
  getLatest: (limit = 5) =>
    API.get(`/reservations?limit=${limit}&sort_by=created_at&order=desc`),
  getOne: (id) => API.get(`/reservations/${id}`),
  create: (data) => API.post("/reservations", data),
  update: (id, data) => API.put(`/reservations/${id}`, data),
  delete: (id) => API.delete(`/reservations/${id}`),
  confirm: (id) => API.post(`/reservations/${id}/confirm`),
  cancel: (id) => API.post(`/reservations/${id}/cancel`),
};
